import React, { useState } from "react";
import APP_PATHS from "../../APP_PATHS.js";
import { withRouter } from "react-router-dom";

const ContactPage = () => {
  return (
    <div id="contact-page" className="page">
      <div className="contact-container">
        <div className="enquiries-half">
          <div className="header-circle">

          </div>
          <img className="double-arrow" alt="double arrow" />
          <div className="description-container">
            Data
          </div>
        </div>
        <div className="feedback-half">
          <div className="header-circle">

          </div>
          <img className="double-arrow" alt="double arrow" />
          <div className="description-container">
            Data
          </div>
          <img className="perp-arrow" alt="perpendicular arrow" />
        </div>
      </div>
    </div>
  );
};

export default ContactPage;
